         'mouseup .selectOnFocus': 'selectTextOnFocus',
         'click #photo-tabs a': 'changeTab',
         'click .add-new-tag': 'addNewTag',
         'mouseenter .adentify-pastille-wrapper': 'showPastillePopover',
